import { useState, useEffect } from "react";
import { Link, useParams } from "react-router-dom";
import axios from "axios";
import AProductDetailOpt from "./AProductDetailOpt";

const AProductDetail = () => {
    const { product_id } = useParams();
    const [product, setProduct] = useState(null);

    const productListGetAxios = () => {
        axios
            .get(`http://localhost:5001/product/admin/detail/${product_id}`)
            .then((res) => {
                console.log("서버 다녀옴", res.data);
                setProduct(res.data);
            })
            .catch((err) => {
                console.error("에러발생 ; ", err);
            });
    };
    useEffect(() => {
        if (!product_id) {
            console.log("id 없음");
            return;
        }
        productListGetAxios();
    }, []);
    if (!product) {
        return <div>id 없음</div>;
    }

    return (
        <div>
            <div>
                <div>제품 상세 내용</div>
                <table border="1">
                    <tr>
                        <td>제품 국문명</td>
                        <td>
                            <input
                                type="text"
                                value={product.product_name_kor}
                            />
                        </td>
                    </tr>
                    <tr>
                        <td>제품 영문명</td>
                        <td>
                            <input
                                type="text"
                                value={product.product_name_eng}
                            />
                        </td>
                    </tr>
                    <tr>
                        <td>제품 스페셜</td>
                        <td>
                            <input
                                type="text"
                                value={product.product_special}
                            />
                        </td>
                    </tr>
                    <tr>
                        <td>제품 카테고리1</td>
                        <td>
                            <input
                                type="text"
                                value={product.product_category_one}
                            />
                        </td>
                    </tr>
                    <tr>
                        <td>제품 카테고리2</td>
                        <td>
                            <input
                                type="text"
                                value={product.product_category_two}
                            />
                        </td>
                    </tr>
                    <tr>
                        <td>제품 카테고리3</td>
                        <td>
                            <input
                                type="text"
                                value={product.product_category_three}
                            />
                        </td>
                    </tr>
                    <tr>
                        <td>제품 향</td>
                        <td>
                            <input type="text" value={product.product_scent} />
                        </td>
                    </tr>
                    <tr>
                        <td>제품 성분</td>
                        <td>
                            <input
                                type="textarea"
                                value={product.product_ingredient}
                            />
                        </td>
                    </tr>
                    <tr>
                        <td>탑노트</td>
                        <td>
                            <input type="text" value={product.nt_name} />
                        </td>
                    </tr>
                    <tr>
                        <td>하트노트</td>
                        <td>
                            <input type="text" value={product.nh_name} />
                        </td>
                    </tr>
                    <tr>
                        <td>베이스노트</td>
                        <td>
                            <input type="text" value={product.nb_name} />
                        </td>
                    </tr>
                    <tr>
                        <td>제품설명</td>
                        <td>
                            <input type="text" value={product.product_intro} />
                        </td>
                    </tr>
                </table>
            </div>
            <AProductDetailOpt />
            <Link to={`/admin/product`}>목록으로</Link>
            <Link to={`/admin/product/modify/${product.product_id}`}>수정</Link>
        </div>
    );
};

export default AProductDetail;
